CREATE TABLE [dbo].[UP_ResourceRiskScores] (
    [Id]        BIGINT        NOT NULL,
    [OwnerType] BIGINT        NOT NULL,
    [Owner_Id]  BIGINT        NOT NULL,
    [ValidFrom] DATETIME2 (2) NOT NULL,
    [ValidTo]   DATETIME2 (2) NOT NULL,
    [Score]     INT           NOT NULL,
    [Rating]    INT           NOT NULL,
    CONSTRAINT [PK_ResourceRiskScores] PRIMARY KEY NONCLUSTERED ([ValidTo] ASC, [Id] ASC),
    CONSTRAINT [CK_ResourceRiskScores] UNIQUE CLUSTERED ([ValidTo] ASC, [OwnerType] ASC, [Owner_Id] ASC, [Id] ASC) WITH (FILLFACTOR = 90, PAD_INDEX = ON)
);


GO
PRINT N'Creating [dbo].[US_AccessCertificationCampaignPolicies]...';


GO
CREATE TABLE [dbo].[US_AccessCertificationCampaignPolicies] (
    [Id]             BIGINT         NOT NULL,
    [Identifier]     VARCHAR (442)  COLLATE SQL_Latin1_General_CP1_CS_AS NOT NULL,
    [DisplayName_L1] NVARCHAR (442) NOT NULL,
    [DisplayName_L2] NVARCHAR (442) NULL,
    [DisplayName_L3] NVARCHAR (442) NULL,
    [DisplayName_L4] NVARCHAR (442) NULL,
    [DisplayName_L5] NVARCHAR (442) NULL,
    [DisplayName_L6] NVARCHAR (442) NULL,
    [DisplayName_L7] NVARCHAR (442) NULL,
    [DisplayName_L8] NVARCHAR (442) NULL,
    CONSTRAINT [PK_AccessCertificationCampaignPolicies] PRIMARY KEY CLUSTERED ([Id] ASC)
);


GO

/*Access certification policy
*/
MERGE "us_accesscertificationcampaignpolicies" AS TARGET USING (values(-1,'Default','Default')) AS SOURCE("id","identifier","displayname_l1") ON TARGET."id" = SOURCE."id" WHEN MATCHED THEN UPDATE SET "identifier"=SOURCE."identifier","displayname_l1"=SOURCE."displayname_l1" WHEN NOT MATCHED THEN INSERT("id","identifier","displayname_l1") VALUES(SOURCE."id", SOURCE."identifier",SOURCE."displayname_l1");
